tables.table_schema:
CREATE TABLE historical_data (
  id SERIAL PRIMARY KEY,
  timestamp TIMESTAMP,
  data_value FLOAT
);

CREATE TABLE forecast_data (
  id SERIAL PRIMARY KEY,
  forecast_id INT,
  forecast_date DATE,
  predicted_value FLOAT
);

CREATE TABLE historical_data (
    id SERIAL PRIMARY KEY,
    date DATE NOT NULL,
    value FLOAT NOT NULL
);

CREATE TABLE predictive_models (
    model_id SERIAL PRIMARY KEY,
    model_name VARCHAR(50) NOT NULL,
    description TEXT,
    creation_date DATE NOT NULL
);

CREATE TABLE forecasts (
    forecast_id SERIAL PRIMARY KEY,
    date DATE NOT NULL,
    predicted_value FLOAT NOT NULL,
    model_id INT REFERENCES predictive_models(model_id)
);

CREATE TABLE historical_data (
    id INT PRIMARY KEY,
    date DATE,
    value FLOAT
);

CREATE TABLE analysis_parameters (
    param_id INT PRIMARY KEY,
    param_name VARCHAR(50),
    param_value FLOAT
);

CREATE TABLE predictions (
    prediction_id INT PRIMARY KEY,
    date DATE,
    predicted_value FLOAT
);

CREATE TABLE forecasting_results (
    result_id INT PRIMARY KEY,
    date DATE,
    prediction FLOAT
);

CREATE TABLE historical_events (
    event_id INT PRIMARY KEY,
    event_name VARCHAR(255),
    event_date DATE,
    event_description TEXT
);

CREATE TABLE historical_sales (
    sale_id INT PRIMARY KEY,
    sale_date DATE,
    product_id INT,
    sale_amount DECIMAL(10, 2)
);

CREATE TABLE historical_weather (
    weather_id INT PRIMARY KEY,
    date DATE,
    temperature FLOAT,
    precipitation FLOAT
);

CREATE TABLE historical_stock_prices (
    stock_id INT PRIMARY KEY,
    stock_symbol VARCHAR(10),
    price DECIMAL(10, 2),
    volume INT
);

CREATE TABLE historical_population (
    city_id INT PRIMARY KEY,
    city_name VARCHAR(255),
    population INT,
    median_income DECIMAL(10, 2)
);
